static __attribute__((__unused__)) PyObject *
SwigPyPacked_New(void *ptr, unsigned int size, swig_type_info *ty)
{
  SwigPyPacked *sobj = PyObject_NEW(SwigPyPacked, SwigPyPacked_type());
  if (sobj)
  {
    void *pack = malloc(size);
    if (pack)
    {
      memcpy(pack, ptr, size);
      sobj->pack = pack;
      sobj->ty = ty;
      sobj->size = size;
    }
    else
    {
      PyObject_DEL((PyObject *)sobj);
      sobj = 0;
    }
  }
  return (PyObject *)sobj;
}

static __attribute__((__unused__)) swig_type_info *
SwigPyPacked_UnpackData(PyObject *obj, void *ptr, unsigned int size)
{
  if (SwigPyPacked_Check(obj))
  {
    SwigPyPacked *sobj = (SwigPyPacked *)obj;
    if (sobj->size != size)
      return 0;
    memcpy(ptr, sobj->pack, size);
    return sobj->ty;
  }
  else
  {
    return 0;
  }
}

/* -----------------------------------------------------------------------------
 * pointers/data manipulation
 * ----------------------------------------------------------------------------- */

static __attribute__((__unused__)) inline PyObject *
_SWIG_This(void)
{
  return SWIG_Python_str_FromChar("this");
}

static PyObject *swig_this = NULL;

static __attribute__((__unused__)) PyObject *
SWIG_This(void)
{
  if (swig_this == NULL)
    swig_this = _SWIG_This();
  return swig_this;
}

static __attribute__((__unused__)) SwigPyObject *
SWIG_Python_GetSwigThis(PyObject *pyobj)
{
  PyObject *obj;

  if (SwigPyObject_Check(pyobj))
    return (SwigPyObject *)pyobj;
  if (ENABLE_SWIGPYTHON_BUILTIN)
  {
    (void)obj;
    if (PyWeakref_CheckProxy(pyobj))
    {
      pyobj = PyWeakref_GET_OBJECT(pyobj);
      if (pyobj && SwigPyObject_Check(pyobj))
        return (SwigPyObject *)pyobj;
    }
    return NULL;
  }
  else
  {
    obj = 0;

    obj = PyObject_GetAttr(pyobj, SWIG_This());
    if (obj)
    {
      Py_DECREF(obj);
    }
    else
    {
      if (PyErr_Occurred())
        PyErr_Clear();
      return 0;
    }
    if (obj && !SwigPyObject_Check(obj))
    {
      /* a PyObject is called 'this', try to get the 'real this'
         SwigPyObject from it */
      return SWIG_Python_GetSwigThis(obj);
    }
    return (SwigPyObject *)obj;
  }
}

/* Acquire a pointer value */

static __attribute__((__unused__)) int
SWIG_Python_AcquirePtr(PyObject *obj, int own)
{
  if (own == SWIG_POINTER_OWN)
  {
    SwigPyObject *sobj = SWIG_Python_GetSwigThis(obj);
    if (sobj)
    {
      int oldown = sobj->own;
      sobj->own = own;
      return oldown;
    }
  }
  return 0;
}

/* Convert a pointer value */

static __attribute__((__unused__)) int
SWIG_Python_ConvertPtrAndOwn(PyObject *obj, void **ptr, swig_type_info *ty, int flags, int *own)
{
  int res;
  SwigPyObject *sobj;
  int implicit_conv = (flags & SWIG_POINTER_IMPLICIT_CONV) != 0;

  if (!obj)
    return SWIG_ERROR;
  if (obj == SWIG_Py_None() && !implicit_conv)
  {
    if (ptr)
      *ptr = 0;
    return SWIG_OK;
  }

  res = SWIG_ERROR;

  sobj = SWIG_Python_GetSwigThis(obj);
  if (own)
    *own = 0;
  while (sobj)
  {
    void *vptr = sobj->ptr;
    if (ty)
    {
      swig_type_info *to = sobj->ty;
      if (to == ty)
      {
        /* no type cast needed */
        if (ptr)
          *ptr = vptr;
        break;
      }
      else
      {
        swig_cast_info *tc = SWIG_TypeCheck(to->name, ty);
        if (!tc)
        {
          sobj = (SwigPyObject *)sobj->next;
        }
        else
        {
          if (ptr)
          {
            int newmemory = 0;
            *ptr = SWIG_TypeCast(tc, vptr, &newmemory);
            if (newmemory == SWIG_CAST_NEW_MEMORY)
            {
              assert(own); /* badly formed typemap which will lead to a memory leak - it must set and use own to delete *ptr */
              if (own)
                *own = *own | SWIG_CAST_NEW_MEMORY;
            }
          }
          break;
        }
      }
    }
    else
    {
      if (ptr)
        *ptr = vptr;
      break;
    }
  }
  if (sobj)
  {
    if (own)
      *own = *own | sobj->own;
    if (flags & SWIG_POINTER_DISOWN)
    {
      sobj->own = 0;
    }
    res = SWIG_OK;
  }
  else
  {
    if (implicit_conv)
    {
      SwigPyClientData *data = ty ? (SwigPyClientData *)ty->clientdata : 0;
      if (data && !data->implicitconv)
      {
        PyObject *klass = data->klass;
        if (klass)
        {
          PyObject *impconv;
          data->implicitconv = 1; /* avoid recursion and call 'explicit' constructors*/
          impconv = PyObject_CallFunctionObjArgs(klass, obj, NULL);
          data->implicitconv = 0;
          if (PyErr_Occurred())
          {
            PyErr_Clear();
            impconv = 0;
          }
          if (impconv)
          {
            SwigPyObject *iobj = SWIG_Python_GetSwigThis(impconv);
            if (iobj)
            {
              void *vptr;
              res = SWIG_Python_ConvertPtrAndOwn((PyObject *)iobj, &vptr, ty, 0, 0);
              if (SWIG_IsOK(res))
              {
                if (ptr)
                {
                  *ptr = vptr;
                  /* transfer the ownership to 'ptr' */
                  iobj->own = 0;
                  res = SWIG_AddCast(res);
                  res = SWIG_AddNewMask(res);
                }
                else
                {
                  res = SWIG_AddCast(res);
                }
              }
            }
            Py_DECREF(impconv);
          }
        }
      }
    }
    if (!SWIG_IsOK(res) && obj == SWIG_Py_None())
    {
      if (ptr)
        *ptr = 0;
      if (PyErr_Occurred())
        PyErr_Clear();
      res = SWIG_OK;
    }
  }
  return res;
}

/* Convert a function ptr value */

static __attribute__((__unused__)) int
SWIG_Python_ConvertFunctionPtr(PyObject *obj, void **ptr, swig_type_info *ty)
{
  if (!PyCFunction_Check(obj))
  {
    return SWIG_Python_ConvertPtr(obj, ptr, ty, 0);
  }
  else
  {
    void *vptr = 0;

    /* here we get the method pointer for callbacks */
    const char *doc = (((PyCFunctionObject *)obj)->m_ml->ml_doc);
    const char *desc = doc ? strstr(doc, "swig_ptr: ") : 0;
    if (desc)
      desc = ty ? SWIG_UnpackVoidPtr(desc + 10, &vptr, ty->name) : 0;
    if (!desc)
      return SWIG_ERROR;
    if (ty)
    {
      swig_cast_info *tc = SWIG_TypeCheck(desc, ty);
      if (tc)
      {
        int newmemory = 0;
        *ptr = SWIG_TypeCast(tc, vptr, &newmemory);
        assert(!newmemory); /* newmemory handling not yet implemented */
      }
      else
      {
        return SWIG_ERROR;
      }
    }
    else
    {
      *ptr = vptr;
    }
    return SWIG_OK;
  }
}

/* Convert a packed value value */

static __attribute__((__unused__)) int
SWIG_Python_ConvertPacked(PyObject *obj, void *ptr, unsigned int sz, swig_type_info *ty)
{
  swig_type_info *to = SwigPyPacked_UnpackData(obj, ptr, sz);
  if (!to)
    return SWIG_ERROR;
  if (ty)
  {
    if (to != ty)
    {
      /* check type cast? */
      swig_cast_info *tc = SWIG_TypeCheck(to->name, ty);
      if (!tc)
        return SWIG_ERROR;
    }
  }
  return SWIG_OK;
}

