/*
  Create a new instance object, without calling __init__, and set the
  'this' attribute.
*/

static __attribute__((__unused__)) PyObject *
SWIG_Python_NewShadowInstance(SwigPyClientData *data, PyObject *swig_this)
{
  PyObject *inst = 0;
  PyObject *newraw = data->newraw;
  if (newraw)
  {
    inst = PyObject_Call(newraw, data->newargs, NULL);
    if (inst)
    {
      if (!ENABLE_SWIG_PYTHON_SLOW_GETSET_THIS)
      {
        PyObject **dictptr = _PyObject_GetDictPtr(inst);
        if (dictptr != NULL)
        {
          PyObject *dict = *dictptr;
          if (dict == NULL)
          {
            dict = PyDict_New();
            *dictptr = dict;
            PyDict_SetItem(dict, SWIG_This(), swig_this);
          }
        }
      }
      else
      {
        PyObject *key = SWIG_This();
        PyObject_SetAttr(inst, key, swig_this);
      }
    }
  }
  else
  {
    inst = ((PyTypeObject *)data->newargs)->tp_new((PyTypeObject *)data->newargs, SWIG_Py_None(), SWIG_Py_None());
    if (inst)
    {
      PyObject_SetAttr(inst, SWIG_This(), swig_this);
      Py_TYPE(inst)->tp_flags &= ~Py_TPFLAGS_VALID_VERSION_TAG;
    }
  }
  return inst;
}

static __attribute__((__unused__)) void
SWIG_Python_SetSwigThis(PyObject *inst, PyObject *swig_this)
{
  PyObject *dict;
  dict = PyObject_GetAttrString(inst, (char *)"__dict__");
  PyDict_SetItem(dict, SWIG_This(), swig_this);
  Py_DECREF(dict);
}

static __attribute__((__unused__)) PyObject *
SWIG_Python_InitShadowInstance(PyObject *args)
{
  PyObject *obj[2];
  if (!SWIG_Python_UnpackTuple(args, "swiginit", 2, 2, obj))
  {
    return NULL;
  }
  else
  {
    SwigPyObject *sthis = SWIG_Python_GetSwigThis(obj[0]);
    if (sthis)
    {
      SwigPyObject_append((PyObject *)sthis, obj[1]);
    }
    else
    {
      SWIG_Python_SetSwigThis(obj[0], obj[1]);
    }
    return SWIG_Py_Void();
  }
}

/* Create a new pointer object */

static __attribute__((__unused__)) PyObject *
SWIG_Python_NewPointerObj(PyObject *self, void *ptr, swig_type_info *type, int flags)
{
  SwigPyClientData *clientdata;
  PyObject *robj;
  int own;

  if (!ptr)
    return SWIG_Py_Void();

  clientdata = type ? (SwigPyClientData *)(type->clientdata) : 0;
  own = (flags & SWIG_POINTER_OWN) ? SWIG_POINTER_OWN : 0;
  if (clientdata && clientdata->pytype)
  {
    SwigPyObject *newobj;
    if (flags & SWIG_BUILTIN_TP_INIT)
    {
      newobj = (SwigPyObject *)self;
      if (newobj->ptr)
      {
        PyObject *next_self = clientdata->pytype->tp_alloc(clientdata->pytype, 0);
        while (newobj->next)
          newobj = (SwigPyObject *)newobj->next;
        newobj->next = next_self;
        newobj = (SwigPyObject *)next_self;
        if (ENABLE_SWIGPYTHON_BUILTIN)
        {
          newobj->dict = 0;
        }
      }
    }
    else
    {
      newobj = PyObject_New(SwigPyObject, clientdata->pytype);
      if (ENABLE_SWIGPYTHON_BUILTIN)
      {
        newobj->dict = 0;
      }
    }
    if (newobj)
    {
      newobj->ptr = ptr;
      newobj->ty = type;
      newobj->own = own;
      newobj->next = 0;
      return (PyObject *)newobj;
    }
    return SWIG_Py_Void();
  }

  assert(!(flags & SWIG_BUILTIN_TP_INIT));

  robj = SwigPyObject_New(ptr, type, own);
  if (robj && clientdata && !(flags & SWIG_POINTER_NOSHADOW))
  {
    PyObject *inst = SWIG_Python_NewShadowInstance(clientdata, robj);
    Py_DECREF(robj);
    robj = inst;
  }
  return robj;
}

/* Create a new packed object */

static __attribute__((__unused__)) inline PyObject *
SWIG_Python_NewPackedObj(void *ptr, unsigned int sz, swig_type_info *type)
{
  return ptr ? SwigPyPacked_New((void *)ptr, sz, type) : SWIG_Py_Void();
}

