static __attribute__((__unused__)) swig_module_info *
SWIG_Python_GetModule(void *(clientdata))
{
  static void *type_pointer = (void *)0;
  /* first check if module already created */
  if (!type_pointer)
  {
    if (ENABLE_SWIG_LINK_RUNTIME)
    {
      type_pointer = SWIG_ReturnGlobalTypeList((void *)0);
    }
    else
    {
      if (ENABLE_SWIGPY_USE_CAPSULE)
      {
        type_pointer = PyCapsule_Import(((char *)"swig_runtime_data"
                                                 "4"
                                                 ".type_pointer_capsule"),
                                        0);
      }
      else
      {
        type_pointer = PyCObject_Import((char *)"swig_runtime_data"
                                                "4",
                                        (char *)"type_pointer");
      }
      if (PyErr_Occurred())
      {
        PyErr_Clear();
        type_pointer = (void *)0;
      }
    }
  }
  return (swig_module_info *)type_pointer;
}

static __attribute__((__unused__)) void
SWIG_Python_DestroyModule(PyObject *obj)
{
  if (ENABLE_SWIGPY_USE_CAPSULE)
  {
    swig_module_info *swig_module = (swig_module_info *)PyCapsule_GetPointer(obj, ((char *)"swig_runtime_data"
                                                                                           "4"
                                                                                           ".type_pointer_capsule"));
    swig_type_info **types = swig_module->types;
    unsigned int i;
    for (i = 0; i < swig_module->size; ++i)
    {
      swig_type_info *ty = types[i];
      if (ty->owndata)
      {
        SwigPyClientData *data = (SwigPyClientData *)ty->clientdata;
        if (data)
          SwigPyClientData_Del(data);
      }
    }
    Py_DECREF(SWIG_This());
    swig_this = NULL;
  }
}
static __attribute__((__unused__)) void
SWIG_Python_DestroyModule(void *vptr)
{
  if (!ENABLE_SWIGPY_USE_CAPSULE)
  {
    swig_module_info *swig_module = (swig_module_info *)vptr;
    swig_type_info **types = swig_module->types;
    unsigned int i;
    for (i = 0; i < swig_module->size; ++i)
    {
      swig_type_info *ty = types[i];
      if (ty->owndata)
      {
        SwigPyClientData *data = (SwigPyClientData *)ty->clientdata;
        if (data)
          SwigPyClientData_Del(data);
      }
    }
    Py_DECREF(SWIG_This());
    swig_this = NULL;
  }
}

static __attribute__((__unused__)) void
SWIG_Python_SetModule(swig_module_info *swig_module)
{
  /* Add a dummy module object into sys.modules */
  PyObject *module = PyImport_AddModule((char *)"swig_runtime_data"
                                                "4");
  if (ENABLE_SWIGPY_USE_CAPSULE)
  {
    PyObject *pointer = PyCapsule_New((void *)swig_module, ((char *)"swig_runtime_data"
                                                                    "4"
                                                                    ".type_pointer_capsule"),
                                      SWIG_Python_DestroyModule);
    if (pointer && module)
    {
      PyModule_AddObject(module, (char *)"type_pointer_capsule", pointer);
    }
    else
    {
      Py_XDECREF(pointer);
    }
  }
  else
  {
    PyObject *pointer = PyCObject_FromVoidPtr((void *)swig_module, SWIG_Python_DestroyModule);
    if (pointer && module)
    {
      PyModule_AddObject(module, (char *)"type_pointer", pointer);
    }
    else
    {
      Py_XDECREF(pointer);
    }
  }
}

/* The python cached type query */
static __attribute__((__unused__)) PyObject *
SWIG_Python_TypeCache(void)
{
  static PyObject *cache = 0;
  if (!cache)
    cache = PyDict_New();
  return cache;
}

static __attribute__((__unused__)) swig_type_info *
SWIG_Python_TypeQuery(const char *type)
{
  PyObject *cache = SWIG_Python_TypeCache();
  PyObject *key = SWIG_Python_str_FromChar(type);
  PyObject *obj = PyDict_GetItem(cache, key);
  swig_type_info *descriptor;
  if (obj)
  {
    if (ENABLE_SWIGPY_USE_CAPSULE)
    {
      descriptor = (swig_type_info *)PyCapsule_GetPointer(obj, NULL);
    }
    else
    {
      descriptor = (swig_type_info *)PyCObject_AsVoidPtr(obj);
    }
  }
  else
  {
    swig_module_info *swig_module = SWIG_Python_GetModule(0);
    descriptor = SWIG_TypeQueryModule(swig_module, swig_module, type);
    if (descriptor)
    {
      if (ENABLE_SWIGPY_USE_CAPSULE)
      {
        obj = PyCapsule_New((void *)descriptor, NULL, NULL);
      }
      else
      {
        obj = PyCObject_FromVoidPtr(descriptor, NULL);
      }
      PyDict_SetItem(cache, key, obj);
      Py_DECREF(obj);
    }
  }
  Py_DECREF(key);
  return descriptor;
}

/*
   For backward compatibility only
*/

static __attribute__((__unused__)) int
SWIG_Python_AddErrMesg(const char *mesg, int infront)
{
  if (PyErr_Occurred())
  {
    PyObject *type = 0;
    PyObject *value = 0;
    PyObject *traceback = 0;
    PyErr_Fetch(&type, &value, &traceback);
    if (value)
    {
      char *tmp;
      PyObject *old_str = PyObject_Str(value);
      Py_XINCREF(type);
      PyErr_Clear();
      if (infront)
      {
        PyErr_Format(type, "%s %s", mesg, tmp = SWIG_Python_str_AsChar(old_str));
      }
      else
      {
        PyErr_Format(type, "%s %s", tmp = SWIG_Python_str_AsChar(old_str), mesg);
      }
      free((void *)(tmp));
      Py_DECREF(old_str);
    }
    return 1;
  }
  else
  {
    return 0;
  }
}

static __attribute__((__unused__)) int
SWIG_Python_ArgFail(int argnum)
{
  if (PyErr_Occurred())
  {
    /* add information about failing argument */
    char mesg[256];
    PyOS_snprintf(mesg, sizeof(mesg), "argument number %d:", argnum);
    return SWIG_Python_AddErrMesg(mesg, 1);
  }
  else
  {
    return 0;
  }
}

static __attribute__((__unused__)) inline const char *
SwigPyObject_GetDesc(PyObject *self)
{
  SwigPyObject *v = (SwigPyObject *)self;
  swig_type_info *ty = v ? v->ty : 0;
  return ty ? ty->str : "";
}

static __attribute__((__unused__)) void
SWIG_Python_TypeError(const char *type, PyObject *obj)
{
  if (type)
  {
    if (obj && SwigPyObject_Check(obj))
    {
      if (ENABLE_SWIG_COBJECT_TYPES)
      {
        const char *otype = (const char *)SwigPyObject_GetDesc(obj);
        if (otype)
        {
          PyErr_Format(PyExc_TypeError, "a '%s' is expected, 'SwigPyObject(%s)' is received",
                       type, otype);
          return;
        }
      }
    }
    else
    {
      const char *otype = (obj ? obj->ob_type->tp_name : 0);
      if (otype)
      {
        PyObject *str = PyObject_Str(obj);
        const char *cstr = str ? SWIG_Python_str_AsChar(str) : 0;
        if (cstr)
        {
          PyErr_Format(PyExc_TypeError, "a '%s' is expected, '%s(%s)' is received",
                       type, otype, cstr);
          free((void *)(cstr));
        }
        else
        {
          PyErr_Format(PyExc_TypeError, "a '%s' is expected, '%s' is received",
                       type, otype);
        }
        Py_XDECREF(str);
        return;
      }
    }
    PyErr_Format(PyExc_TypeError, "a '%s' is expected", type);
  }
  else
  {
    PyErr_Format(PyExc_TypeError, "unexpected type is received");
  }
}

/* Convert a pointer value, signal an exception on a type mismatch */
static __attribute__((__unused__)) void *
SWIG_Python_MustGetPtr(PyObject *obj, swig_type_info *ty, int(argnum), int flags)
{
  void *result;
  if (SWIG_Python_ConvertPtr(obj, &result, ty, flags) == -1)
  {
    PyErr_Clear();
    if (ENABLE_SWIG_POINTER_EXCEPTION)
    {
      if (flags)
      {
        SWIG_Python_TypeError(SWIG_TypePrettyName(ty), obj);
        SWIG_Python_ArgFail(argnum);
      }
    }
  }
  return result;
}

static __attribute__((__unused__)) int
SWIG_Python_NonDynamicSetAttr(PyObject *obj, PyObject *name, PyObject *value)
{
  if (ENABLE_SWIGPYTHON_BUILTIN)
  {
    PyTypeObject *tp = obj->ob_type;
    PyObject *descr;
    PyObject *encoded_name;
    descrsetfunc f;
    int res = -1;

    if (PyString_Check(name))
    {
      name = PyUnicode_Decode(PyString_AsString(name), PyString_Size(name), NULL, NULL);
      if (!name)
        return -1;
    }
    else if (!PyUnicode_Check(name))
    {
      PyErr_Format(PyExc_TypeError, "attribute name must be string, not '%.200s'", name->ob_type->tp_name);
      return -1;
    }
    else
    {
      Py_INCREF(name);
    }

    if (!tp->tp_dict)
    {
      if (PyType_Ready(tp) < 0)
        goto done;
    }

    descr = _PyType_Lookup(tp, name);
    f = NULL;
    if (descr != NULL)
      f = descr->ob_type->tp_descr_set;
    if (!f)
    {
      if (PyString_Check(name))
      {
        encoded_name = name;
        Py_INCREF(name);
      }
      else
      {
        encoded_name = PyUnicode_AsUTF8String(name);
      }
      PyErr_Format(PyExc_AttributeError, "'%.100s' object has no attribute '%.200s'", tp->tp_name, PyString_AsString(encoded_name));
      Py_DECREF(encoded_name);
    }
    else
    {
      res = f(descr, obj, value);
    }

  done:
    Py_DECREF(name);
    return res;
  }
}

